import React from "react";

const ProgressSteps = ({ active }) => {
  return (
    <div>
      <p
        className={
          active
            ? "border-b-4 border-purple-500 text-purple-500"
            : "border-4 border-gray-400 text-gray-600"
        }
      >
        signin
      </p>
      <p
        className={
          active
            ? "border-b-4 border-purple-500 text-purple-500"
            : "border-4 border-gray-400 text-gray-600"
        }
      >
        shipping
      </p>
      <p
        className={
          active
            ? "border-b-4 border-purple-500 text-purple-500"
            : "border-4 border-gray-400 text-gray-600"
        }
      >
        payments
      </p>
      <p
        className={
          active
            ? "border-b-4 border-purple-500 text-purple-500"
            : "border-4 border-gray-400 text-gray-600"
        }
      >
        place order
      </p>
    </div>
  );
};

export default ProgressSteps;
